<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN" "http://www.w3.org/TR/html4/loose.dtd">
<html>
<head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <title>数据操作</title>
    <link rel="stylesheet" href="https://lucent-crumble-4fc305.netlify.app/css/weui.css"/>
    <script src="https://lucent-crumble-4fc305.netlify.app/js/vue.global.min.js"></script>
    <style type="text/css">
        table {
            border-collapse: collapse;
            margin: 0 auto;
            text-align: center;
        }

        table td, table th {
            border: 1px solid #cad9ea;
            color: #666;
            height: 30px;
        }

        table thead th {
            background-color: #CCE8EB;
            width: 100px;
        }

        table tr:nth-child(odd) {
            background: #fff;
        }

        table tr:nth-child(even) {
            background: #F5FAFA;
        }

        .cycleTime {
            width: 60px;
            height: 30px;
            border-radius: 5px;
            border: 1px solid #cad9ea;
            font-size: 16px;
            text-align: center;
        }
    </style>
</head>
<body>
<div id="app">
    <div style="width: 800px;margin: 10px auto 10px auto;" v-if="logined">
        <a href="javascript:" role="button" v-on:click="openSelect"
           class="weui-btn weui-btn_mini weui-btn_primary weui-wa-hotarea">批量运行{{selectCount}}个</a>&nbsp;&nbsp;
        <a href="javascript:" v-on:click="selectAll" role="button"
           class="weui-btn weui-btn_mini weui-btn_default weui-wa-hotarea">全选/反选</a>&nbsp;&nbsp;
        <a href="javascript:" role="button" class="weui-btn weui-btn_mini weui-btn_warn weui-wa-hotarea"
           v-on:click="reset">恢复出厂</a>
    </div>

    <div class="weui-cells_checkbox" v-if="logined">
        <table style="width: 800px;margin: 0px auto;">
            <thead>
            <th>选择</th>
            <th>序号</th>
            <th>动作名称</th>
            <th>一般耗时</th>
            <th>开启周期</th>
            <th>操作</th>
            </thead>
            <tr v-for="(item,index) in taskList" :key="item">
                <td>
                    <label style="width: 30px;margin: 0px auto;" :for=`s${index}`
                           class="weui-cell weui-cell_active weui-check__label">
                        <input type="checkbox" :id=`s${index}` class="weui-check" name="checkbox1"
                               v-model="item.select"/>
                        <i class="weui-icon-checked"></i>
                    </label>
                </td>
                <td>{{index + 1}}</td>
                <td>{{item.name}}</td>
                <td>{{item.costTime}}</td>
                <td>
                    <label :for=`c${index}` class="weui-cell weui-cell_active weui-cell_switch">
                        <div class="weui-cell__ft">
                            <input aria-labelledby="cb_txt" :id=`c${index}` class="weui-switch" type="checkbox"
                                   v-model="item.cycle"/>
                        </div>
                        <template v-if="item.cycle">
                            <div class="weui-cell__bd" id="cb_txt" aria-hidden="true" style="width: 145px;">
                                每<input v-model="item.cycleTime" class="cycleTime" v-on:change="changeTime(index)"> 秒运行
                            </div>
                        </template>
                    </label>
                </td>
                <td style="padding: 0px 10px;min-width: 140px;">
                    <a href="javascript:" target="_blank" role="button" v-on:click="run(item.name,item.url,'单个手动')"
                       class="weui-btn weui-btn_mini weui-btn_primary weui-wa-hotarea">
                        <template v-if="item.cycleLeft != null">
                            <i class="weui-mask-loading"></i>
                        </template>
                        运行
                        <template v-if="item.cycleLeft != null">
                            ({{item.cycleLeft}})
                        </template>
                    </a>
                </td>
            </tr>
        </table>
    </div>
    <div style="width: 800px; margin: 0px auto; font-size: 14px; color: #8f8f8f;">
        <div v-for="item in runList" :key="item">{{timeAgo(item.time)}} {{item.name}} 运行 [{{item.handle}}]</div>
    </div>
</div>
